import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="container">
      <div className="task-container">
        <div id="form-wrapper">
          <form id="form">
            <div className="flex-wrapper">
              <div style={{ flex: 6 }}></div>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default App;
